import React, { Component } from "react";

class WaitNavBar extends Component {

    render() {
        return (
        <div className="ui red borderless inverted menu">
            <div className="item">
            <div className="ui yellow massive button" onClick={this.props.handleClick}>Home</div>
            </div>
            <div className="item">
            <div className="ui green massive button">{this.props.user.username}</div>
            </div>
        </div>
        );
    }
}

export default WaitNavBar;
